        public async Task<string> InsertImageToFireBaseAsync(string convertedImage)
        {
            FirebaseResponse response = await client.GetTaskAsync("Counter/Node");
            Counter_class get = response.ResultAs<Counter_class>();

            FireBaseData fireBaseData = new FireBaseData
            {
                Id = (Convert.ToInt32(get.cnt) + 1).ToString(),

            };
            int size = convertedImage.Length;
            int sizeDividedFive = size / 5;
            int last = size - 4 * sizeDividedFive;

            var data = new Image_Modal
            {
                ImagePart1 = convertedImage.Substring(0, sizeDividedFive),
                ImagePart2 = convertedImage.Substring(sizeDividedFive, sizeDividedFive),
                ImagePart3 = convertedImage.Substring(sizeDividedFive * 2, sizeDividedFive),
                ImagePart4 = convertedImage.Substring(sizeDividedFive * 3, sizeDividedFive + last),
            };

            SetResponse responseImage = await client.SetTaskAsync("Images/" + fireBaseData.Id, data);
            Image_Modal result = responseImage.ResultAs<Image_Modal>();

            var obj = new Counter_class
            {
                cnt = fireBaseData.Id
            };

            SetResponse counterResponse = await client.SetTaskAsync("Counter/Node", obj);

            return "success";
        }

        public async Task<List<string>> RetriveAllImagesFromFireBase()
        {
            List<string> result = new List<string>();

            FirebaseResponse response = await client.GetTaskAsync("Counter/Node");
            Counter_class get = response.ResultAs<Counter_class>();

            string temp;

            for (int i = 0; i < Convert.ToInt32(get.cnt); ++i)
            {
                int p = i + 1;
                string path = "Images/" + p.ToString();
                FirebaseResponse responseImage = await client.GetTaskAsync(path);
                Image_Modal image = responseImage.ResultAs<Image_Modal>();
                temp = image.ImagePart1 + image.ImagePart2 + image.ImagePart3 + image.ImagePart4;
                result.Add(temp);
            }

            return result;
        }

        async Task<string> IFireBase.InsertImageToFireBaseAsync(string convertedImage)
        {
            var task = await InsertImageToFireBaseAsync(convertedImage);
            return "success";
        }

        public List<Dictionary<string, string>> RetrieveDataFromSQLServer()
        {
            List<Dictionary<string, string>> result = new List<Dictionary<string, string>>();
            SqlConnection sqlConnection = new SqlConnection("Server=(localdb)\\MSSQLLocalDB; initial catalog=DAL.PlanetContext;");
            sqlConnection.Open();
            SqlCommand sqlCommand = new SqlCommand("Select * from Planets", sqlConnection);
            SqlDataReader sqlDataReader;
            sqlDataReader = sqlCommand.ExecuteReader();

            if (sqlDataReader.HasRows)
            {
                while (sqlDataReader.Read())
                {
                    Dictionary<string, string> keyValuePairs = new Dictionary<string, string>();

                    keyValuePairs.Add("Name", sqlDataReader["Name"].ToString());
                    keyValuePairs.Add("ImagesPath", sqlDataReader["ImagesPath"].ToString());
                    keyValuePairs.Add("Mass", sqlDataReader["mass"].ToString());
                    keyValuePairs.Add("Diameter", sqlDataReader["diameter"].ToString());
                    keyValuePairs.Add("Density", sqlDataReader["density"].ToString());
                    keyValuePairs.Add("Gravity", sqlDataReader["gravity"].ToString());
                    keyValuePairs.Add("Rotation_Period", sqlDataReader["rotation_period"].ToString());
                    keyValuePairs.Add("distance_from_sun", sqlDataReader["distance_from_sun"].ToString());
                    keyValuePairs.Add("mean_temperature", sqlDataReader["mean_temperature"].ToString());
                    keyValuePairs.Add("Discription", sqlDataReader["Description"].ToString());

                    result.Add(keyValuePairs);

                }
            }
            

            return result;
        }
    }
